If you're a true blue foodie, you know that @SingaporeFoodFestival is truly the one time of the year where you can get the best of Singapore's culinary scene.

What I loveeeeee about it is how creative our chefs and brands get, and how new and old always collide. Lots of hot food for you to order, cooking kits where you cook-a-long during the Live Masterclasses, so check out http://www.singaporefoodfestival.sg/ to get involved and eating!

@Visit_Singapore #SingaporeFoodFestival #SingapoRediscovers #SingapoReimagine

